    `,frameworks:["Typescript","CSS"],buttons:[{label:"Demo: Link Combiner",url:"https://671432.github.io/GW2gameLinkCombiner/",disabled:!1},{label:"Code: Link Combiner",url:"https://github.com/671432/GW2gameLinkCombiner",disabled:!1}]},{title:"Solar System",bg:VE,images:[jE,zE],whatIsIt:`
